import BacktoMain from "../images/Icon_ArrowBack.png";
import { Link } from "react-router-dom";

function Header() {
  return (
    <Link to="/main">
      <img
        src={BacktoMain}
        alt="ArrowBack"
        className="absolute w-[25px] h-[25px] mt-[40px] ml-[-300px]"
      />
    </Link>
  );
}

export default Header;
